If you want to use existing multiple keys (instead of ephemeral ones) you can pass them as part of the network configuration. In that case it's recommended to not read them from TOML file. If you need to read them for the filesystem/os it's best if you use environment variables. Once you've read them in a safe manner you should programmatically add them to Seth's Config struct (which safe parts can be read from TOML file). You can either add them directly to Network, if it's already set up, or you can add them to Networks slice to the network you intend to use. For example you could start by reading the TOML configuration first: cfg, err := seth.ReadCfg()
if err != nil { log.Fatal(err)
} Then read the private keys in a safe manner. For example from a secure vault or environment variables: var privateKeys []string
var err error
privateKeys, err = some_utils.ReadPrivateKeysFromEnv()
if err != nil { log.Fatal(err)
} and then add them to the Network you plan to use. Let's assume it's called Sepolia: for i, network := range cfg.Networks { if network.Name == "Sepolia" { cfg.Networks[i].PrivateKeys = privateKeys }
} Or if you aren't using [[Networks]] in your TOML config and have just a single Network: cfg.Network.PrivateKeys = privateKeys Or... you can use the convenience function AppendPksToNetwork() to have them added to both the Network and Networks slice: added := cfg.AppendPksToNetwork(privateKeys, "Sepolia")
if !added { log.Fatal("Network Sepolia not found in the config")
} Finally, proceed to create a new Seth instance: seth, err := seth.NewClientWithConfig(cfg)
if err != nil { log.Fatal(err)
} A working example can be found here as TestSmokeExampleMultiKeyFromEnv test. Currently, there's no safe way to pass multiple keys to CLI. In that case TOML is the only way to go, but you should be mindful that if you commit the TOML file with keys in it, you should assume they are compromised and all funds on them are lost.

