First, let's define a struct that will hold our Gun implementation: type ExampleGun struct { target string client *resty.Client Data []string
} Our Gun will send a GET request to the target URL. If the request is successful, we return a *wasp.Response containing the response data. If it fails or responds with an HTTP status other than 200, we also return a *wasp.Response with the response and an error. Here’s the implementation of the Gun interface: func (m *ExampleGun) Call(l *wasp.Generator) *wasp.Response { var result map[string]interface{} r, err := m.client.R(). SetResult(&result). Get(m.target) if err != nil { return &wasp.Response{Data: result, Error: err.Error()} } if r.Status() != "200 OK" { return &wasp.Response{Data: result, Error: "not 200"} } return &wasp.Response{Data: result}
} note By default, WASP stores all successful and failed responses, but you can use a Sampler to store only some of the successful ones. You can read more about it here .

