Now, let’s compare metrics. Since we have []string, we’ll first convert it to []float64, calculate the median, and ensure the difference between the averages is less than 1%. Again, this is just an example—you should decide the best way to validate your metrics. Here we are explicitly aggregating them using an average to get a single number representation of each metric, but for your case a median or percentile or yet some other aggregate might be more appropriate. var compareAverages = func(t *testing.T, metricName string, currentAsStringSlice, previousAsStringSlice map[string][]string, maxPrecentageDiff float64) { require.NotEmpty(t, currentAsStringSlice[metricName], "%s results were missing from current report", metricName) require.NotEmpty(t, previousAsStringSlice[metricName], "%s results were missing from previous report", metricName) currentFloatSlice, err := benchspy.StringSliceToFloat64Slice(currentAsStringSlice[metricName]) require.NoError(t, err, "failed to convert %s results to float64 slice", metricName) currentMedian, err := stats.Mean(currentFloatSlice) require.NoError(t, err, "failed to calculate median for %s results", metricName) previousFloatSlice, err := benchspy.StringSliceToFloat64Slice(previousAsStringSlice[metricName]) require.NoError(t, err, "failed to convert %s results to float64 slice", metricName) previousMedian, err := stats.Mean(previousFloatSlice) require.NoError(t, err, "failed to calculate median for %s results", metricName) var diffPrecentage float64 if previousMedian != 0.0 && currentMedian != 0.0 { diffPrecentage = (currentMedian - previousMedian) / previousMedian * 100 } else if previousMedian == 0.0 && currentMedian == 0.0 { diffPrecentage = 0.0 } else { diffPrecentage = 100.0 } assert.LessOrEqual(t, math.Abs(diffPrecentage), maxPrecentageDiff, "%s medians are more than 1% different", metricName, fmt.Sprintf("%.4f", diffPrecentage))
} compareAverages( t, string(benchspy.MedianLatency), currentAsStringSlice, previousAsStringSlice, 1.0,
)
compareAverages(t, string(benchspy.Percentile95Latency), currentAsStringSlice, previousAsStringSlice, 1.0)
compareAverages(t, string(benchspy.MaxLatency), currentAsStringSlice, previousAsStringSlice, 1.0)
compareAverages(t, string(benchspy.ErrorRate), currentAsStringSlice, previousAsStringSlice, 1.0) warning Standard Loki metrics are all calculated using a 10 seconds moving window, which results in smoothing of values due to aggregation. To learn what that means in details, please refer to To Loki or Not to Loki chapter. Also, due to the HTTP API endpoint used, namely the query_range, all query results are always returned as a slice . Execution of instant queries that return a single data point is currently not supported .

