Since WASP stores AUT responses in each generator, you can create custom metrics based on this data. For example, to calculate the timeout ratio: var generator *wasp.Generator var timeouts = func(responses *wasp.SliceBuffer[*wasp.Response]) (float64, error) { if len(responses.Data) == 0 { return 0, nil } timeoutCount := 0.0 inTimeCount := 0.0 for _, response := range responses.Data { if response.Timeout { timeoutCount++ } else { inTimeCount++ } } return timeoutCount / (timeoutCount + inTimeCount), nil
} directExecutor, err := NewDirectQueryExecutor(generator, map[string]DirectQueryFn{ "timeout_ratio": timeouts,
})
require.NoError(t, err, "failed to create Direct Query Executor")

