If you do not want to set all the parameters, you can use a simplified progammatical configuration. Here's an example: cfg := seth.DefaultConfig("ws://localhost:8546", []string{"ac0974bec39a17e36ba4a6b4d238ff944bacb478cbed5efcae784d7bf4f2ff80"})
client, err := seth.NewClientWithConfig(cfg)
if err != nil { log.Fatal(err)
} This config uses what we consider reasonable defaults, such as: 5 minute transaction confirmation timeout 1 minute RPC node dial timeout enabled EIP-1559 dynamic fees and automatic gas prices estimation (with 200 blocks history; will auto-disable itself if RPC doesn't support EIP-1559) tracing only of reverted transaction to console and DOT graphs checking of RPC node health on client creation no ephemeral keys

